import React from 'react'



const Tasks = () => {

    const [tasks, setTasks] = useState([
        {
            id: 1,
            text: "Doctors Appointment",
            day: "5th Fab 2020",
            reminder: true,
        },
        {
            id: 2,
            text: "Play Football",
            day: "12th Fab 2020",
            reminder: true,
        },
        {
            id: 3,
            text: "Study Geography",
            day: "23th Fab 2020",
            reminder: false,
        }
    ]);

    // setTasks([...tasks, {text: "Going To Gym"}]);
    return (
    <>
      {tasks.map( (task) => (<h3 key={task.id}>{task.text}</h3>) )}
    </>
  )
}

export default Tasks
